import React from "react";
import { Icon } from "Shared/svg/Icon";
import SimpleSlider from "Shared/PhotoSlider/SimpleSlider";
import Data from "Entites/Data";
import {
  PhotoConteiner,
  SimpleSliderConteiner,
  BtnDesktop,
  VectorTop,
  MainConteiner,
  InfoConteiner,
  Name,
  Position,
  PersonConteiner,
  Surname,
} from "./style";
import AboutPerson from "./about/AboutPerson";

export default function PersonPage() {
  const { name, surname, patronymic, position } = Data.person;
  return (
    <MainConteiner>
      <PhotoConteiner>
        <SimpleSliderConteiner>
          <SimpleSlider />
        </SimpleSliderConteiner>
        <BtnDesktop></BtnDesktop>
      </PhotoConteiner>
      <InfoConteiner>
        <Icon id="man" className="man" />
        <VectorTop />
        <PersonConteiner>
          <Surname> {surname} </Surname>

          <Name>
            {name} {patronymic}
          </Name>
          <Position>{position}</Position>
        </PersonConteiner>
      </InfoConteiner>
    </MainConteiner>
  );
}
